import React, {useState, useMemo} from 'react'

const UseMemoHook = () => {
    const [count, setCount] = useState(0)

    const handleClick = () => {
        setCount(count)
    }

  return (
    <div>
      <h2>Count: {count}</h2>
      <button onClick={handleClick}>Increment</button>
    </div>
  )
}

export default UseMemoHook
